import { UserElement } from "../../assets/propTypes";
import { USER } from '../actionTypes';

const initialState: UserElement = {
  job: false,
  country: 'tr',
  service: 156,
  quoteNumber: 2,
  deal: false
};

type action = {
  type: string,
  payload: any
}


export default function (state = initialState, action: any) {
  switch (action.type) {
    case USER.DEAL: {
      const response = { ...state }
      response.deal = action.payload
      return response
    }
    default:
      return state
  }
}
